const e='{"head": [{"t": "h1", "c": "Antoine de Saint-Exup\xE9ry", "p": 0}, {"t": "h2", "c": "Le petit prince", "p": 1}], "body": [{"t": "h2", "c": "Chapitre XXIII", "p": 546}, {"t": "text", "c": ["- Ils ne poursuivent rien du tout, dit l\u2019aiguilleur.", "Ils dorment l\xE0-dedans, ou bien ils b\xE2illent.", "Les enfants seuls \xE9crasent leur nez contre les vitres."], "p": 546}, {"t": "text", "c": ["- Les enfants seuls savent ce qu\u2019ils cherchent, fit le petit prince.", "Ils perdent du temps pour une poup\xE9e de chiffons, et elle devient tr\xE8s importante, et si on la leur enl\xE8ve, ils pleurent\u2026", "- Ils ont de la chance, dit l\u2019aiguilleur."], "p": 547}, {"t": "text", "c": ["- Bonjour, dit le petit prince."], "p": 549}, {"t": "text", "c": ["- Bonjour, dit le marchand."], "p": 550}, {"t": "text", "c": ["C\u2019\xE9tait un marchand de pilules perfectionn\xE9es qui apaisent la soif. On en avale une par semaine et l\u2019on n\u2019\xE9prouve plus le besoin de boire."], "p": 551}, {"t": "text", "c": ["- Pourquoi vends-tu \xE7a ? dit le petit prince. - C\u2019est une grosse \xE9conomie de temps, dit le marchand. Les experts ont fait des calculs. On \xE9pargne cinquante-trois minutes par semaine."], "p": 553}]}';export{e as default};
